import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div style={{width: '100%', height: '100%'}}>
      <div style={{display: 'flex'}}>
        <div style={{display: 'flex', justiftContent: 'center', alignItems: 'center', width: '50%', height: '40px', color: 'white'}}>
        Game
        </div>
        <div style={{display: 'flex', justiftContent: 'center', alignItems: 'center', width: '50%', height: '40px', color: 'white'}}>
        Draw Map
        </div>
      </div>
    </div>
    );
}

export default App;
